40.009 486781.499, 123138.084 486777.797, 123125.107 486785.467, 123126.921 486788.952, 123124.052 486790.618, 123120.398 486790.708, 123112.554 486795.258, 123107.294 486798.309, 123106.883 486798.547, 123102.548 486801.062, 123098.876 486803.192, 123094.41 486805.784, 123090.502 486808.051, 123085.919 486810.711, 123034.988 486840.488, 123029.998 486843.208, 123016.643 486850.883, 123019.25 486855.269, 123014.866 486857.758, 123012.496 486853.609, 122972.069 486877.904, 122967.048 486880.911, 122951.791 486889.72, 122944.282 486894.055, 122939.286 486896.94, 122932.401 486901.043, 122878.945 486932.902, 122873.461 486931.685, 122855.773 486941.886, 122854.278 486947.328, 122826.703 486963.246, 122817.382 486968.626, 122731.734 487018.066, 122690.214 487042.092))','Toen buiten de oude zeedijk (St. Antoniesdijk) veel land was aangeslibd, werd een zomerkade of kadijk aangelegd. Oorspronkelijk sprak men van de nieuwe zeedijk, maar die raakte naderhand in onbruik. Bij een verdere verhoging van deze nieuwe dijk sprak men van de Laagte en de Hoogte van de Kadijk. De Tussen Kadijken heette tot 1943 Korte Kerkstraat. Deze ligt namelijk in het verlengde van de Plantage Kerklaan, maar is daar nimmer mee verbonden geweest.','3594','Naamgeving uitgegeven',8,'2019-06-28','15989','HOOGTE KADK','1',false,'1','GV00001729',NULL,NULL,NULL),
	 ('0363300000003916','2014-01-10',NULL,'Weg','Nieuwe Nieuwstraat','Nieuwe Nieuwstraat','SRID=28992;POLYGON ((121373.014 487605.827, 121377.185 487605.81, 121388.628 487605.807, 121410.419 487606.931, 121426.574 487607.682, 121446.941 487608.505, 121449.999 487607.747, 121457.562 487605.838, 121458.73 487603.025, 121464.72 487615.624, 121449.999 487613.072, 121436.296 487612.597, 121410.231 487612.212, 121387.04 487612.021, 121384.54 487612.045, 121377.287 487611.854, 121372.419 487611.95, 121349.228 487611.759, 121321.265 487611.664, 121320.679 487610.978, 121315.326 487604.707, 121373.014 487605.827))','Bij vroedschapsresolutie van 1550 werd besloten tot de aanleg van een nieuwe straat bij de Korsjespoort, deze straat werd eenvoudig ''nieuwe straat'' genoemd. Dertig jaar later werden het Sint Geertruidenklooster en het Lieve Vrouwengasthuis afgebroken dat tussen de Nieuwezijds Voorburgwal en de Nieuwendijk stond. Ook hier kreeg een der nieuw aangelegde straten de naam van de ''nieuwe straat''. Om beide nieuwe straten te onderscheiden, kregen de namen in de eerste helft van de zeventiende eeuw de toevoeging ''Oude'' en ''Nieuwe'', en deze namen hebben ze tot op heden behouden. De Nieuwe Nieuwstraat werd aanvankelijk ook Nieuwe Herenstraat genoemd.','3594','Naamgeving uitgegeven',8,'2019-06-28','26093','NW NIEUWSTR','1',false,'1','GV00001729',NULL,NULL,NULL),
