.834 486307.4, 123134.915 486312.637, 123138.965 486315.261, 123147.194 486320.593, 123156.119 486326.347, 123172.019 486339.769, 123187.267 486349.974, 123192.416 486353.42, 123202.535 486359.844, 123230.529 486378.089, 123244.059 486391.399, 123250.248 486401.868, 123293.07 486445.324, 123325.168 486476.881, 123334.11 486485.672, 123347.9 486499.23, 123350.752 486502.034, 123363.783 486514.846, 123448.779 486598.999, 123464.162 486600.315, 123491.932 486622.318, 123495.76 486625.55, 123528.429 486651.149, 123545.222 486678.008, 123560.623 486697.358, 123555.242 486699.588, 123547.297 486702.881, 123540.312 486705.776, 123534.923 486708.009, 123519.317 486688.736, 123510.763 486678.015, 123499.626 486669.924, 123491.839 486665.363, 123469.218 486648.532, 123453.414 486636.429, 123449.979 486633.736, 123444.984 486629.822, 123439.989 486625.907, 123432.958 486612.144, 123423.078 486601.469, 123417.244 486601.809, 123418.44 486618.454, 123414.199 486618.629, 123413.479 486606.03, 123402.052 486606.68, 123401.322 486600.231, 123393.309 486600.788, 123393.03 486595.419, 123375.43 486588.18, 123373.34 486589.76, 123361.756 486594.472, 123355.381 486583.442, 123358.289 486581.796, 123351.307 486570.348))','Samuel Sarphati (1813-1866), Amsterdams arts en apotheker met veel relaties in bankierskringen. Heeft veel voor de stad gedaan. Zo maakte hij onder andere plannen tot uitbreiding van de stad rond het Frederiksplein en buiten de Singelgracht, waartoe hij in 1864 de Nederlandsche Bouwmaatschappij oprichtte. Van de verenigingen en gebouwen die door zijn toedoen tot stand kwamen, kunnen worden genoemd: de Maatschappij voor Landbouw (1848), de Vereeniging voor Volksvlijt (1852) met het door haar gebouwde Paleis voor Volksvlijt (1864), de Handelsschool, de Nationale Hypotheekbank, het Amstel Hotel (1866). Voordat het Sarphatipark benoemd werd, vormden de rondliggende straten gedeelten van de Ceintuurbaan, Jan Steenstraat, Van der Helststraat en Sweelinckstraat. De Sarphatistraat komt oorspronkelijk voor onder de naam Schans.','3594','Naamgeving uitgegeven',8,'2019-06-28','31917','SARPHATISTR','1',false,'1','GV00001729',NULL,NULL,NULL),
